 /* 创建表结构 `mxd_article_class`  */
 DROP TABLE IF EXISTS `mxd_article_class`;/* MySQLReback Separation */ CREATE TABLE `mxd_article_class` (
  `ac_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '索引ID',
  `ac_code` varchar(20) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '分类标识码',
  `ac_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '分类名称',
  `ac_parent_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '父ID',
  `ac_sort` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `ac_title` varchar(255) DEFAULT NULL COMMENT '标题',
  `ac_key` varchar(255) DEFAULT NULL COMMENT '关键词',
  `ac_desc` text COMMENT '描述',
  PRIMARY KEY (`ac_id`),
  KEY `ac_parent_id` (`ac_parent_id`)
) ENGINE=MyISAM AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='文章分类表';/* MySQLReback Separation */
