  `status` tinyint(3) NOT NULL DEFAULT '1' COMMENT '状态:0关闭1开启',
  `displayorder` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `upid` (`upid`,`d_sort`)
) ENGINE=MyISAM AUTO_INCREMENT=45052 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='地区信息表';/* MySQLReback Separation */
